import React, {useState} from 'react';
import Child3 from "./Child3";

const Parent3 = () => {
    const [name, setName] = useState('');
   const handlerChange = (name) => {
       setName(name)
   }
    return (
        <div>
            <h1>Parent component</h1>
            <p>Name is: {name}</p>
        <Child3 change={handlerChange}/>
        </div>
    );
};

export default Parent3;
